def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return None
    result = []
    for segment in input1.split(' '):
        parts = segment.split('-')
        transformed = parts[0] + ''.join(part.capitalize() for part in parts[1:])
        result.append(transformed)
    return ' '.join(result)
